l.','','',1,'udsftldiri','FTDMISF',12,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1080,'lava','crms-nacc','udsftldiri3',13,'ftdwaste','8. If the subject is sure he/she is right about something, he/she doesn\'t waste much time listening to other people\'s arguments.','','',1,'udsftldiri','FTDWASTE',13,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1081,'lava','crms-nacc','udsftldiri3',14,'ftdpity','9. If the subject sees someone being treated unfairly, the subject doesn\'t feel much pity for him/her.','','',1,'udsftldiri','FTDPITY',14,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1082,'lava','crms-nacc','udsftldiri3',15,'ftdqtouc','10. The subject is often quite touched by things he/she sees happen.','','',1,'udsftldiri','FTDQTOUC',15,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1083,'lava','crms-nacc','udsftldiri3',16,'ftdsides','11. The subject believes that there are two sides to every question and tries to look at both of them.','','',1,'udsftldiri','FTDSIDES',16,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1084,'lava','crms-nacc','udsftldiri3',17,'ftdsofth','12. I would describe the subject as a pretty soft-hearted person.','','',1,'udsftldiri','FTDSOFTH',17,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1085,'lava','crms-nacc','udsftldiri3',18,'ftdupset','13. If the subject is upset at someone, the subject usually tries to put him/herself in \"the other person\'s shoes\" for a while.','','',1,'udsftldiri','FTDUPSET',18,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1086,'lava','crms-nacc','udsftldiri3',19,'ftdcriti','14. Before criticizing me, the subject is likely to imagine how he/she would feel if he/she were in my place.','','',1,'udsftldiri','FTDCRITI',19,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1087,'lava','crms-nacc','udsftldiri3',20,'ftdiriec','15. Empathic Concern Score (EC)','','',0,'udsftldiri','FTDIRIEC',20,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1088,'lava','crms-nacc','udsftldiri3',21,'ftdiript','16. Perspective-taking Score (PT)','','',0,'udsftldiri','FTDIRIPT',21,'smallint','',1,'null',NULL,NULL,'2012-10-01 19:05:05'),(1089,'lava','crms-nacc','udsftldrsms3',1,'ftdcpc6f','0. The questionnaire was completed','','',1,'udsftldrsms','FTDCPC6F',1,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1090,'lava','crms-nacc','udsftldrsms3',2,'ftdalter','1. In social situations, the subject has the ability to alter his/her behavior if he/she feels something else is called for.','','',1,'udsftldrsms','FTDALTER',2,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1091,'lava','crms-nacc','udsftldrsms3',3,'ftdemot','2. The subject is often able to correctly read people\'s true emotions through their eyes.','','',1,'udsftldrsms','FTDEMOT',3,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1092,'lava','crms-nacc','udsftldrsms3',4,'ftdacros','3. The subject has the ability to control the way he/she comes across to people, depending on the impression he/she wants to give.','','',1,'udsftldrsms','FTDACROS',4,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1093,'lava','crms-nacc','udsftldrsms3',5,'ftdconv','4. In conversations, the subject is sensitive to even the slightest change in the facial expression of the person he/she is conversing with.','','',1,'udsftldrsms','FTDCONV',5,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1094,'lava','crms-nacc','udsftldrsms3',6,'ftdintui','5. The subject\'s powers of intuition are quite good when it comes to understanding others.','','',1,'udsftldrsms','FTDINTUI',6,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1095,'lava','crms-nacc','udsftldrsms3',7,'ftdjoke','6. The subject can usually tell when others consider a joke in bad taste, even though they may laugh convincingly.','','',1,'udsftldrsms','FTDJOKE',7,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1096,'lava','crms-nacc','udsftldrsms3',8,'ftdimagp','7. When the subject feels that the image he/she is projecting isnt working, he/she can readily change to something that does.','','',1,'udsftldrsms','FTDIMAGP',8,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1097,'lava','crms-nacc','udsftldrsms3',9,'ftdinapp','8. The subject can usually tell when he/she said something inappropriate by reading it in the listener\'s eyes.','','',1,'udsftldrsms','FTDINAPP',9,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1098,'lava','crms-nacc','udsftldrsms3',10,'ftdchbeh','9. The subject has trouble changing his/her behavior to suit different people and different situations.','','',1,'udsftldrsms','FTDCHBEH',10,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1099,'lava','crms-nacc','udsftldrsms3',11,'ftdadbeh','10. The subject can adjust his/her behavior to meet the requirements of any situation he/ she is in.','','',1,'udsftldrsms','FTDADBEH',11,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1100,'lava','crms-nacc','udsftldrsms3',12,'ftdlying','11. If someone is lying to the subject, he/she usually knows it at once from that person\'s manner or expression.','','',1,'udsftldrsms','FTDLYING',12,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1101,'lava','crms-nacc','udsftldrsms3',13,'ftdgoodf','12. Even when it might be to his/her advantage, the subject has difficulty putting up a good front.','','',1,'udsftldrsms','FTDGOODF',13,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1102,'lava','crms-nacc','udsftldrsms3',14,'ftdregul','13. Once the subject knows what the situation calls for, its easy for him/her to regulate his/ her actions accordingly.','','',1,'udsftldrsms','FTDREGUL',14,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1103,'lava','crms-nacc','udsftldrsms3',15,'ftdsmscr','14. Sensitiviy to Socio-emotional Expressiveness Score (EX) (0-30)','','',0,'udsftldrsms','FTDSMSCR',15,'smallint','',1,'null',NULL,NULL,'2012-10-02 12:12:53'),(1104,'lava','crms-nacc','udsftldrsms3',16,'